// import App from 'next/app'
import Layout from "../components/layout";
import { motion } from "framer-motion";

function MyApp({ Component, pageProps, router }) {
  return (
    <Layout>
      <motion.div
        initial="pageInitial"
        animate="pageAnimate"
        variants={{
          pageInitial: {
            opacity: 0,
          },
          pageAnimate: {
            opacity: 1,
          },
        }}
      >
        <Component {...pageProps} />
      </motion.div>
    </Layout>
  );
}

